import React from "react";
import { Col, Row, Container, Navbar, Nav } from "react-bootstrap";
import "./style.css";


function Cardie (props){
    return(

            <>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </>
    )
}

const Footer = () => {
    return (
        <div style={{color: '#aaaaaa', background: "#111111" , position: "absolute", left:"0" , right:"0"}}>
        <Container style={{paddingTop:"100pt", paddingBottom: "100pt"}}>
        <Row>

            <Col>

            </Col>      
        </Row>
        </Container>
        <Navbar expand="md" variant="dark" className="nav">
  <Container>
    <Navbar.Brand href="#">Quoto</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}
        navbarScroll
      >

      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>
        </div>
     );
}

export default Footer;
